var nations = [];
var topfive = [];
var botfive = [];
function generate(num){
    
    for(var i=0; i<num;i++){
        var nation = getNation();
        nations.push(nation);
        var postal = getPostal(nation);
        var urban = getUrban(nation);
        var age = getAge(nation);
        var sex = getSex(nation, age);
        if(i < 9){
            document.write("<div class='large'><span><span class='num'>"+(i+1)+".  &nbsp&nbsp"+"</span><span class='flag-icon flag-icon-"+postal.toLowerCase()+"'></span>"+"&nbsp"+sex+"&nbsp"+urban+"&nbsp"+"<a target='_blank' href='https://en.wikipedia.org/wiki/"+nation+"'>"+nation+"</a></span></div>");
        }
        else{
            document.write("<div class='large'><span><span class='num'>"+(i+1)+". "+"</span><span class='flag-icon flag-icon-"+postal.toLowerCase()+"'></span>"+"&nbsp"+sex+"&nbsp"+urban+"&nbsp"+"<a target='_blank' href='https://en.wikipedia.org/wiki/"+nation+"'>"+nation+"</a></span></div>");
        }
    }


    var count = nations.reduce(function(country, freq) {
        country[freq] = (country[freq] || 0) + 1;
        return country;
    }, {});

    var beni = JSON.stringify(count);
    var geni = beni.split(":");
    var teni = beni.split(/[:,]/);
    teni[teni.length-1] = teni[teni.length-1].slice(-2,-1);
    var xeni = teni.slice();
    var keni = geni.map(function (x) { 
        return parseInt(x, 10); 
    });
    keni.sort((a, b) => b - a);
    var gum; var dum; var chum; var post;
    for(i=1;i<6;i++){
        var pum = keni[i];
        gum = teni.indexOf(JSON.stringify(pum));
        dum = teni[gum-1];
        if(dum==undefined){
            // do nothing
        }
        else {
            dum = dum.replace(/['{"]+/g, '');
            post = getPostal(dum);
            chum = ("</span><span class='flag-icon flag-icon-"+post.toLowerCase()+"'></span>"+"&nbsp"+dum+" : "+pum);
            topfive.push(chum);
            teni[gum] = "zzz";
        }
    }
    //console.log(xeni)
    for(i=1;i<6;i++){
        gum = xeni.indexOf("1");
        //console.log(gum);
        dum = xeni[gum-1];
        if(dum==undefined){
            // do nothing
        }
        else{
            dum = dum.replace(/['{"]+/g, '');
            post = getPostal(dum);
            chum = ("</span><span class='flag-icon flag-icon-"+post.toLowerCase()+"'></span>"+"&nbsp"+dum+" : "+"1");
            botfive.push(chum);
            xeni[gum] = "zzz";
        }
    }
    //console.log(xeni)
}